import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import pic1 from "./pics/fireplanet1.png";
import pic2 from "./pics/fireplanet2.PNG";
import $ from "jquery";
import ArtBody from "./components/ArtBody";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = { rows: [] };

    // const artworks = [
    //   { id: 0, img: pic1, title: "Your Mom" },
    //   { id: 1, img: pic2, title: "Second pic" }
    // ];

    // artworks.forEach(artwork => {
    //   artworkCards.push(
    //     <div className="card">
    //       <h2>title:</h2>
    //       <p>{artwork.title}</p>{" "}
    //     </div>
    //   );
    // });
    this.searchFunction();
  }

  searchFunction() {
    var apiEndpointBaseURL = "https://api.harvardartmuseums.org/object";
    var queryString = $.param({
      apikey: "19142ab0-6cf9-11ea-8bdc-95909fa24347",
      title: "rabbit",
      classification: "Paintings"
    });

    $.getJSON(apiEndpointBaseURL + "?" + queryString, function(data) {
      console.log(data.records);
      const pieces = data.records;
      var artworkCards = [];
      pieces.forEach(piece => {
        var artworkCard = <ArtBody piece={piece}></ArtBody>;
        artworkCards.push(artworkCard);
      });
      console.log(artworkCards);
      this.setState = { rows: artworkCards };
    });
  }
  render() {
    return (
      <div className="App">
        <header className="toolbar">
          <ul>
            <li className="title">Cooper Hewitt</li>
            <li className="about">About</li>
          </ul>
        </header>
        <div class="contentContainer">{this.state.rows}</div>
      </div>
    );
  }
}

export default App;
